    "# Plot average reward as a function of time.\n",
    "stats <- ddply(results,\n",
    "               c(\"T\"),\n",
    "               function (df) {mean(df$Reward)})\n",
    "ggplot(stats, aes(x = T, y = V1)) +\n",
    "  geom_line() +\n",
    "  ylim(0, 1) +\n",
    "  xlab(\"Time\") +\n",
    "  ylab(\"Average Reward\") +\n",
    "  ggtitle(\"Performance of the UCB1 Algorithm\")\n",
    "#ggsave(\"r/graphs/ucb1_average_reward.pdf\")\n",
    "\n"
   ]
